import "../styles/categories.css"
import placeholder from "../assets/imgs/istockphoto-1147544807-612x612.jpg";

function Categories() {
    return (
      <div className="categories-global">
        <img src={placeholder} alt="placeholder" />
        <img src={placeholder} alt="placeholder" />
        <img src={placeholder} alt="placeholder" />
      </div>
    );
  }
  
  export default Categories;
